const TokenService = {
    saveAuthToken(token){
        window.localStorage.setItem(process.env.TOKEN_KEY, token);
    },
    getAuthToken(){
        return window.localStorage.getItem(process.env.TOKEN_KEY);
    },
    clearAuthToken(){
        window.localStorage.removeItem(process.env.TOKEN_KEY)
    }
};



module.exports = TokenService;
